import React, { Component } from "react";
import "./SideBar.scss";
import logoImg from "Img/logo.png";

class SideBar extends Component {
  render() {
    return (
      <div className="sideBar">
        <img src={logoImg} />
        <ul>
          <li>점술판</li>
          <li>클둥이 목록</li>
          <li>관리자</li>
        </ul>
      </div>
    );
  }
}

export default SideBar;
